import React from 'react';
import PropTypes from 'prop-types';
import { useLocation } from 'react-router-dom';

const Checkout = () => {
  // Access location from useLocation hook
  const location = useLocation();
  const { shippingDetails } = location.state;

  // You need to define totalPrice and handleConfirm functions to use in your component
  const totalPrice = 0; // Define your totalPrice logic here
  const handleConfirm = () => {}; // Define your handleConfirm logic here

  return (
    <div className="container">
      <h2>Checkout</h2>
      <div className="card">
        <div className="card-body">
          <h3 className="card-title">Shipping Details</h3>
          {/* Access shippingDetails properties */}
          <p className="card-text">Name: {shippingDetails.name}</p>
          <p className="card-text">Address: {shippingDetails.address}</p>
          <p className="card-text">Email: {shippingDetails.email}</p>
        </div>
      </div>
      <div className="card mt-3">
        <div className="card-body">
          <h3 className="card-title">Total Price: ${totalPrice}</h3>
        </div>
      </div>
      <button className="btn btn-primary mt-3" onClick={handleConfirm}>Confirm Checkout</button>
    </div>
  );
};

// You don't need to define propTypes since you're not receiving props from a parent component

export default Checkout;
